script: |
  super -f text -I q4502.spq | sort > q4502.out

inputs:
  - name: q4502.spq
    data: |
      SELECT DISTINCT col0 + - 91 + - + 94 + - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 <> ( - 83 * - + CAST ( NULL AS INTEGER ) * - col1 );
  - name: tab0

outputs:
  - name: q4502.out
    data: |
